import { View, Text, TextInput, TouchableOpacity, StyleSheet } from "react-native";

const MainScreen= () => {
    return(
        <View>
            <Text>Main Screen</Text>
            <TextInput
            placeholder="Task"
            />
            <TouchableOpacity>
                <Text>Add Task</Text>
            </TouchableOpacity>
        </View>
    );

};

export default MainScreen
